import AuthService from "./services/auth.service";
import { Link, useHistory, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import images1 from "./images/social.JPG";
import p from "./images/21.jpg";
const Contact = () => {
 
  return (
    <div
      classname="main"
      style={{
        backgroundImage: "url(" + p + ")",
        backgroundSize: "cover",
        height: "89vh",
        backdropFilter: "blur",
      }}
    >
      <h6 style={{ textAlign: "center", color: "white", fontSize: "50px" }}>
        You may Contact us
      </h6>
      <p style={{ textAlign: "center", color: "white", fontSize: "30px" }}>
        Customer Care Numbers:1225 OR 5287-7895462 / 0214-9864751
        <p>Language: Hindi/English</p>
        <p>Email: care@indianrail.co.in</p>
        <p></p>
      </p>

      <br></br>
      <br></br>
    </div>
  );
};

export default Contact;
